import styles from './MainSection.module.css';
import soster from './soster.png';

export default function MainSection(props) {
    return (
        <div className={ styles.MainSectionBackground }>
            <div>
            Koronavirus
            Päivittyvä seuranta
            </div>
        </div>
    )
}
